import React, { useState } from 'react';
import { FaTimes } from 'react-icons/fa';

function popupreq()
{
  return(
    <div class="Modal">
    <div class="Modal_content">
        <span>
            <FaTimes className="Close" />
        </span>
        <label>Name: </label>
        <input
            name="name"
            placeholder=""
           // onChange={handleChangeInput}
        />
         <label>Email: </label>
        <input
            name="email"
            placeholder=""
           // onChange={handleChangeInput}
        />
        <label>City: </label>
        <input
            name="city"
            placeholder=""
          //  onChange={handleChangeInput}
        />
        <label>Phone Number: </label>
        <input
            name="phonenumber"
            placeholder=""
            //onChange={handleChangeInput}
        />
        <button
            className="AddButton"
            onClick={handleClickOnAddButton}>
            Add
        </button>
     </div>
   </div >
  );
}
export default popupreq;
